import * as yaml from "js-yaml";
export class Extend {
    content;
    constructor(content) {
        this.content = content;
    }
}
export const extend = (content) => new Extend(content);
export const extendYamlType = new yaml.Type("!extend", {
    kind: "scalar",
    construct: (data) => extend(data),
    represent: (data) => data.content,
    instanceOf: Extend,
});
